@kishorets1 LEFT JOINs make it obvious what table is the "base" table for the JOIN. You can assume the base is the left-most table

table1 LEFT JOIN table2 LEFT JOIN table3 it's obvious table1 is the base

table1 LEFT JOIN table2 RIGHT JOIN TABLE table3 what's the base? table3 is the base

